import sys
import functools


class Solution:
    def maxPartitionsAfterOperations(self, s: str, k: int) -> int:

        # amount of partitions starting consumption at idx, when current
        # partition already has given chars in the set and whether or not there
        # is still an option to change a character
        @functools.cache
        def f(idx: int, cur_set: int, can_change: bool) -> int:
            # print('f(%s, %s, %s)' % (idx, cur_set, can_change))

            if idx == len(s):
                if cur_set:
                    return 1
                # is this branch possible?
                return 0

            best = 0

            # consume as-is (no replacement)
            c = s[idx]
            c_num = ord(c) - ord('a')
            c_bit = 1 << c_num

            assert 0 <= c_num < 26

            if c_bit & cur_set:
                # already see, have to consume it further
                best = f(idx + 1, cur_set | c_bit, can_change)
            else:
                # bit was not in the cur_set
                set_size = cur_set.bit_count()
                if set_size == k:
                    best = 1 + f(idx + 1, c_bit, can_change)
                else:
                    best = f(idx + 1, cur_set | c_bit, can_change)

            if not can_change:
                return best

            # try replacing!
            for repl_num in range(26):
                # suppose we replaced current char with another
                repl_bit = 1 << repl_num

                if repl_bit & cur_set:
                    continue

                set_size = cur_set.bit_count()
                if set_size == k:
                    cur_result = 1 + f(idx + 1, repl_bit, False)
                else:
                    cur_result = f(idx + 1, cur_set | repl_bit, False)

                best = max(best, cur_result)

            return best

        return f(0, 0, True)


if __name__ == '__main__':
    sys.setrecursionlimit(10**6)

    x = Solution()
    print(x.maxPartitionsAfterOperations(s = "xyz", k = 2), 2)
    print(x.maxPartitionsAfterOperations(s = "abcxyz", k = 1), 6)

    print(x.maxPartitionsAfterOperations(s = "acb", k = 2), 2)
    print(x.maxPartitionsAfterOperations(s = "ccb", k = 2), 2)
    print(x.maxPartitionsAfterOperations(s = "accca", k = 2), 3)
    print(x.maxPartitionsAfterOperations(s = "acccccccccca", k=2), 3)
    print(x.maxPartitionsAfterOperations(s = "aabaab", k = 3), 1)
    print(x.maxPartitionsAfterOperations(s = "xxyz", k = 1), 4)
    print(x.maxPartitionsAfterOperations(s = "baacccb", k = 1), 6)
    print(x.maxPartitionsAfterOperations(s = "babacbbbabbc", k = 3), 3)
    print(x.maxPartitionsAfterOperations(s = "bbbbcbcbbc", k = 2), 3)

    # # wtf leetcode has "4" as correct answer here?
    print('wtf, leetcode?')
    print(x.maxPartitionsAfterOperations("abcdefghijklmnopqrstuvwxyzabcdefghijklmnopqrstuvwxzabcdefghijklmnopqrstuvwxy", 25), 4)

    print(x.maxPartitionsAfterOperations("", 2))
    print(x.maxPartitionsAfterOperations("", 2))
    print(x.maxPartitionsAfterOperations("", 1))
